import itertools
from collections import defaultdict
from functools import lru_cache
from math import sqrt, floor
from bisect import bisect_left, bisect_right
from random import randint


MAX = 150

def primes():
    """
    See http://stackoverflow.com/a/3796442.
    """

    D = {}
    yield 2
    for q in itertools.islice(itertools.count(3), 0, None, 2):
        p = D.pop(q, None)
        if p is None:
            D[q*q] = q
            yield q
        else:
            x = q + 2*p
            while x in D:
                x += 2*p
            D[x] = p

P = primes()
primelist = [next(P), ]
while primelist[-1] < 2*MAX:   # use 10000000 here to compute d ...
    primelist.append(next(P))


def is_prime(x):
    if x <= primelist[-1]:
        i = bisect_left(primelist, x)
        if i != len(primelist) and primelist[i] == x:
            return True
        return False
    else:
        for i in range(2, floor(sqrt(x)) + 1):
            if x % i == 0:
                return False
        return True


e = defaultdict(int)
for p in primelist[:2*MAX]:
    for i in range(p+1):
        for j in range(p, 2*MAX+1):
            e[i, j] += 1


